import React from 'react';
import Aux from '../../hoc/Aux'
import Layout from './Layout.module.css'
const layout = (props) => (
    <Aux>
        <div className={Layout.Content} >Toolbar,Sidedrawer,Backdrop</div>

        <main>{props.children}</main>
    </Aux>
);

export default  layout;
